//AppController.js

const redisClient = require('../utils/redis');
const dbClient = require('../utils/db');
const { promisify } = require('util');
const setTimeout = promisify(setTimeout);

module.exports.status = async (req, res) => {
    res.json({
        alive: redisClient.isAlive(),
        nbUsers: await dbClient.nbUsers(),
        nbFiles: await dbClient.nbFiles()
    });
}

module.exports.stats = async (req, res) => {
    res.json({
        nbUsers: await dbClient.nbUsers(),
        nbFiles: await dbClient.nbFiles()
    });
}

module.exports.sleep = async (req, res) => {
    await setTimeout(() => {
        res.json({
            message: 'sleep'
        });
    }, 5000);
}

module.exports.error = async (req, res) => {
    throw new Error('Error');
}

module.exports.notFound = async (req, res) => {
    res.status(404).json({
        message: 'Not found'
    });
}
